import { Link } from 'react-router-dom';

function Footer() {
    return (
        <footer className="footer">
            <span className="footer__copy">&copy; 2022 Supersite, Powered by News API</span>
            <nav className="footer__navigation">
                <ul className="footer__navigation-content">
                    <li className="footer__navigation-item">
                        <Link className="footer__navigation-link" to="/">Home</Link>
                        <Link className="footer__navigation-link" to="https://practicum.yandex.com">Practicum by Yandex</Link>
                        <Link className="footer__navigation-link" to="https://github.com/veralea">
                            <div className="footer__social footer__social-github"></div>
                        </Link>
                        <Link className="footer__navigation-link" to="https://www.facebook.com/profile.php?id=100015397681525">
                            <div className="footer__social footer__social-facebook"></div>
                        </Link>
                    </li>
                </ul>
            </nav>
        </footer>
    );
}

export default Footer;
